parameters.jsCode:
// Format DeepSeek AI structured response for Google Sheets update
try {
  const assessment = $input.item.json.output; 
  const candidateData = $('Prepare DeepSeek Assessment Data1').item.json;
  const candidateEmail = candidateData.candidateEmail;

  console.log('Processing DeepSeek assessment for:', candidateEmail);
  console.log('Overall Score:', assessment.overallScore);
  console.log('Recommendation:', assessment.recommendation);

  // Create the detailed summary 
  const detailedSummary = [
    ...(assessment.strengths || []),
    ...(assessment.developmentAreas || []),
    assessment.cognitiveAssessment?.ccatScore,
    assessment.cognitiveAssessment?.eppScore,
    assessment.cognitiveAssessment?.talentSignal,
    assessment.cognitiveAssessment?.learningAgility,
    assessment.culturalFit
  ]
  .filter(item => item && item.trim() !== '')
  .join(',');

  // Format for Google Sheets update
  return {
    json: {
      email: candidateEmail,
      candidateInfo: {
        email: candidateEmail,
        fullName: candidateData.candidateInfo?.fullName || 'Not provided',
        phone: candidateData.candidateInfo?.phone || 'Not provided',
        applicationDate: candidateData.candidateInfo?.applicationDate || 'Not provided',
        originalData: candidateData
      },

      'Job Longevity': assessment.leadershipScore.toString(),
      'CV Integrity': assessment.technicalProficiencyScore.toString(),
      'Assessment Summary': assessment.summary,
      'Overall Score': assessment.overallScore.toString(),
      'Recommendation': assessment.recommendation,
      'Summary': detailedSummary,

      assessmentDetails: {
        method: 'DeepSeek AI',
        assessmentDate: new Date().toISOString(),
        leadershipScore: assessment.leadershipScore,
        operationalExcellenceScore: assessment.operationalExcellenceScore,
        vendorManagementScore: assessment.vendorManagementScore,
        technicalProficiencyScore: assessment.technicalProficiencyScore,
        qualityFocusScore: assessment.qualityFocusScore,
        strengths: assessment.strengths || [],
        developmentAreas: assessment.developmentAreas || [],
        roleSpecificAssessment: assessment.roleSpecificAssessment || {},
        experienceAlignment: assessment.experienceAlignment || {},
        cognitiveAssessment: assessment.cognitiveAssessment || {},
        culturalFit: assessment.culturalFit,
        priorityLevel: assessment.priorityLevel
      }
    }
  };

} catch (error) {
  console.error('DeepSeek processing error:', error);
  const candidateData = $('Prepare DeepSeek Assessment Data1').item.json;
  const candidateEmail = candidateData.candidateEmail;

  return {
    json: {
      email: candidateEmail,
      'Job Longevity': '0',
      'CV Integrity': '0',
      'Assessment Summary': 'AI assessment processing failed - manual review required',
      'Overall Score': '0',
      'Recommendation': 'MAYBE',
      'Summary': 'Assessment failed: ' + error.message
    }
  };
}

// Get the candidate data and CV extraction results
const candidateData = $('Has Candidates?1').item.json;
const cvExtraction = $input.item.json;

const candidateEmail = candidateData.Email || candidateData['Email Address'] || 'Unknown';

console.log('Processing candidate:', candidateEmail);

// Build the assessment prompt with structured data
const assessmentPrompt = {
  cvData: {
    text: cvExtraction.text || '',
    metadata: {
      numPages: cvExtraction.numpages,
      title: cvExtraction.info?.Title,
      author: cvExtraction.info?.Author
    }
  },

  candidateInfo: {
    email: candidateEmail,
    fullName: candidateData['Full Name'] || candidateData['First Name'] || 'Not provided',
    phone: candidateData.PhoneNo || 'Not provided',
    applicationDate: candidateData.Date || 'Not provided'
  },

  assessmentScores: {
    talentSignal: candidateData['Talent Signal'] || '0',
    ccatRawScore: candidateData['CCAT Raw Score'] || '0',
    eppAssessment: candidateData['EPP Overall Assessment'] || '0',
    clpt: candidateData['CLPT'] || 'Not provided'
  },

  formResponses: {
    distributedTeamExperience: candidateData['1. (a) How many years of experience do you have leading and managing distributed or remote teams?'] || 'Not provided',
    teamLeadershipRating: candidateData['(b) How would you rate yourself out of 10 in team leadership, mentorship, and building high-performing teams?'] || 'Not provided',
    offshoreManagement: candidateData['2. (a) Years of direct experience managing outsourced or offshore teams?'] || 'Not provided',
    creativeOperations: candidateData['3. (a) Years of experience in creative operations, digital production, or e-commerce?'] || 'Not provided',
    vendorExperience: candidateData['5. (a) Years of experience managing third-party logistics (3PL) providers or external production vendors?'] || 'Not provided',
    digitalFashion: candidateData['6. (a) Years of experience in digital fashion, virtual styling, or AI-generated imagery?'] || 'Not provided',
    aiAutomation: candidateData['7. (a) Do you have experience implementing AI, automation, or new technologies in production workflows?'] || 'Not provided'
  },

  assets: {
    cvUrl: candidateData['Please upload your CV/Resume here.'] || 'Not provided',
    videoUrl: candidateData['Please upload a short video'] || 'Not provided'
  },

  systemStatus: {
    googleFormStatus: candidateData['Google Form Status'] || 'N/A',
    hireSelectStatus: candidateData['HR Select Status'] || 'N/A'
  }
};

return assessmentPrompt;

// Log DeepSeek assessment results
const assessments = $input.all();

console.log(`\n=== DEEPSEEK AI ASSESSMENT RESULTS ===`);
console.log(`Processed: ${assessments.length} candidates`);

assessments.forEach((item, index) => {
  const data = item.json;
  console.log(`\nCandidate ${index + 1}: ${data.email || 'Unknown'}`);
  console.log(`   Overall Score: ${data['Overall Score'] || 'N/A'}/100`);
  console.log(`   Recommendation: ${data.Recommendation || 'N/A'}`);
});

return assessments;

// Filter candidates ready for DeepSeek assessment
const candidates = $input.all();
const readyForAssessment = [];

for (const item of candidates) {
  const candidate = item.json;

  // Check if already assessed
  if (candidate['Overall Score'] && candidate['Overall Score'] !== '0' && candidate['Overall Score'] !== '') {
    console.log(`Skipping ${candidate.Email} - already assessed`);
    continue;
  }

  // Check if has CV
  if (!candidate.Field || candidate.Field === '') {
    console.log(`Skipping ${candidate.Email} - no CV uploaded`);
    continue;
  }

  readyForAssessment.push(item);
}

console.log(`Found ${readyForAssessment.length} candidates ready for assessment`);

if (readyForAssessment.length === 0) {
  return [{ json: { hasCandidates: false, message: 'No candidates ready for assessment' } }];
}

return readyForAssessment.map(item => ({
  json: {
    ...item.json,
    hasCandidates: true
  }
}));
